import axios from 'axios';

axios.defaults.baseURL = `https://pixabay.com/api/?q=cat&page=1&key=30662426-21982097d0559eebc608a0eec&`;

export const fetchPictureWithQuery = async searchQuery => {
  try {
    const response = await axios.get(`q=${searchQuery}&image_type=photo`);
    return response.data.hits;
  } catch (error) {
    console.error('Error fetching pictures:', error);
    return [];
  }
};

export default {
  fetchPictureWithQuery,
};
